import ListItem from "./ListItem"


const List = ({list, response}) => {
    var apiResults = [];
    if (list.length > 0) {
        apiResults = list[0].map(item => <ListItem key={item.id} movie={item}/>)
    }

    const content = apiResults?.length ? apiResults: <h1>No matching movies</h1>
    return (
        <main>{content}</main>
    )

}
export default List
